import React, { Component } from "react";
import Background from '../images/background_image.png';

var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: "url(" + { Background } + ")"
};

class Landing extends Component {
    render() {
        return (
        <div>
            <div>
                {/* <div id="landing-image" className="landing-hero"></div> */}
                <img src="https://static1.squarespace.com/static/5391ec89e4b0b156e79a61d0/5a4fd1b78165f5c5be346030/5a77bba6f9619a31bd5f8ed8/1517796266888/DSCF7620.jpg"></img>
            </div>
        </div>
        )
    }
}

export default Landing;
